css:
@-moz-document url-prefix("http://www.google"), url-prefix("https://www.google")
{
/* 
    Kezel Benoit Google Theme
 */

  img#hplogo,
div#hplogo,
div#pmocntr2
  {
    display: none;
  }

  div#lga
  {
    margin-top: 5em !important;
    width: 0 !important;
    height: 115px !important;
    padding-left: 400px !important;
    background-image: url("https://lh3.googleusercontent.com/-WiqESAy87sM/WS56l3yshvI/AAAAAAAAAP0/1yUyzePJ7m0BBjkPzKUAGKJiDywtkWTRQCL0B/w400-d-h100-p/Cool-Text-245817005483500.png") !important;
    background-repeat: no-repeat !important;
  }

  body
  {
    background-repeat: repeat !important;
    background-image: url("http://i.imgur.com/82FbFvi.gif") !important;
    background-size: 100%;
  }

  em,
cite
  {
    color: white !important;
    text-shadow: black 0px 0px 1px !important;
  }

  a,
spam,
p
  {
    color: #00FFFF !important;
    text-shadow: black 0px 0px 1px !important;
  }

  div[id="leftnav"],
div#appbar,
div#topabar,
div#gb
  {
    background: #000000 !important;
    opacity: 0.9 !important;
  }

  span[id="gbi4t"]
  {
    color: black !important;
    text-shadow: black 0px 0px 1px !important;
  }

  li,
div
  {
    color: #00FFFF !important;
    text-shadow: black 0px 0px 1px !important;
  }

  DIV#flci a
  {
    background: black;
    color: blue !important;
    font-weight: bold;
    text-shadow: black 0px 0px 1px !important;
  }

  #fsr:after
  {
    content: " Animated Google Rainbow Hexagon by Kezel Benoit";
    margin-left: 30px !important;
  }

  .gbit
  {
    color: black !important;
    text-shadow: black 0px 0px 1px !important;
  }

  #hdtbSum
  {
    background-color: black !important;
    opacity: 0.9 !important;
  }

  .fbar
  {
    background: rgb(0, 0, 0)!important;
  }

  .gb_nb
  {
    background: rgba(21, 65, 13, 1)!important;
  }

  #hdtb
  {
    background: rgba(21, 65, 13, 0.5)!important;
  }

  div#lga
  {
    margin-top: 195px !important;
  }

  .sfbgg, .rl_item, #fbar
  {
    background-color: #000000!important;
  }

  .sbqs_c
  {
    color: red !important;
    text-shadow: black 0px 0px 0px !important;
  }
}
